import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';

function Login() {
  const [email, setEmail] = useState('');
  const [senha, setSenha] = useState('');
  const [mensagem, setMensagem] = useState('');
  const navigate = useNavigate();

  // Redirects automatically if already logged in
  useEffect(() => {
    const user = localStorage.getItem('user');
    if (user) {
      navigate('/home');
    }
  }, [navigate]);

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const resposta = await axios.post('http://localhost:5000/api/users/login', {
        email,
        senha
      });

      if (resposta.data.success) {
        const { id, nome, tipo } = resposta.data.usuario;

        localStorage.setItem('user', JSON.stringify({
          id,
          nome,
          role: tipo
        }));

        setMensagem('Login realizado com sucesso!');
        navigate('/home');
      } else {
        setMensagem('Email ou senha incorretos.');
      }
    } catch (erro) {
      setMensagem('Erro ao conectar. Verifique o backend.');
      console.error(erro);
    }
  };

  return (
    <div style={styles.cadastroContainer}>
      <img src="/logo.png" alt="Logo AgroPlanner" style={styles.logo} />
      <h2 style={styles.titulo}>AgroPlanner</h2>
      <div style={styles.socialIcons}>
        <i className="fa-brands fa-instagram"></i>
        <i className="fa-brands fa-facebook"></i>
        <i className="fa-brands fa-google"></i>
      </div>
      <form style={styles.formulario} onSubmit={handleSubmit}>
        <label htmlFor="email" style={styles.label}>E-mail:</label>
        <input
          type="email"
          id="email"
          placeholder="Digite seu e-mail"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          style={styles.input}
          required
        />
        <input
          type="password"
          id="senha"
          placeholder="Digite sua senha"
          value={senha}
          onChange={(e) => setSenha(e.target.value)}
          style={styles.input}
          required
        />
        <button type="submit" style={styles.button}>Fazer login</button>
      </form>
      {mensagem && <p style={styles.mensagem}>{mensagem}</p>}
      <Link to="/cadastro" style={styles.criarContaLink}>
        Criar conta
      </Link>
    </div>
  );
}

const styles = {
  cadastroContainer: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    minHeight: '100vh',
    padding: '20px',
    backgroundColor: '#f5f5f5',
    fontFamily: 'Arial, sans-serif',
  },
  logo: {
    maxWidth: '150px',
    marginBottom: '20px',
  },
  titulo: {
    color: '#2d6a4f',
    marginBottom: '10px',
  },
  socialIcons: {
    display: 'flex',
    gap: '15px',
    marginBottom: '20px',
    fontSize: '24px',
    color: '#344e41',
  },
  formulario: {
    display: 'flex',
    flexDirection: 'column',
    width: '100%',
    maxWidth: '400px',
    padding: '30px',
    backgroundColor: '#fff',
    borderRadius: '10px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
  },
  label: {
    marginBottom: '5px',
    color: '#555',
  },
  input: {
    width: 'calc(100% - 20px)',
    padding: '10px',
    marginBottom: '15px',
    border: '1px solid #ccc',
    borderRadius: '5px',
    fontSize: '16px',
    backgroundColor: '#fff',
  },
  button: {
    padding: '12px 20px',
    backgroundColor: '#2d6a4f',
    color: '#fff',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    fontSize: '16px',
    fontWeight: 'bold',
    transition: 'background-color 0.3s',
  },
  mensagem: {
    marginTop: '15px',
    color: '#d62828',
    textAlign: 'center',
    fontWeight: 'bold',
  },
  criarContaLink: {
    marginTop: '10px',
    color: '#2d6a4f',
    textDecoration: 'none',
    fontWeight: 'bold',
  }
};

export default Login;
